INSERT INTO `wp_posts` VALUES (15, 1, '2014-01-21 13:28:21', '2014-01-21 13:28:21', 'Esto es una página de ejemplo. Es diferente a una entrada porque permanece fija en un lugar y se mostrará en la navegación de tu sitio (en la mayoría de los temas). La mayoría de la gente empieza con una página de Acerca de, que les presenta a los potenciales visitantes del sitio. Podría ser algo como esto:\n<blockquote>¡Hola! Soy mensajero por el día, aspirante a actor por la noche, y este es mi blog. Vivo en Madrid, tengo un perrazo llamado Duque y me gustan las piñas coladas (y que me pille un chaparrón)</blockquote>\n...o algo así:\n<blockquote>La empresa XYZ se fundó en 1971 y ha estado ofreciendo "cosas" de calidad al público desde entonces. Situada en Madrid, XYZ emplea a más de 2.000 personas y hace todo tipo de cosas sorprendentes para la comunidad de Madrid.</blockquote>\nSi eres nuevo en WordPress deberías ir a <a href="http://localhost/www.rodrigodemingo.com.ar/wp-admin/">tu escritorio</a> para borrar esta páginay crear páginas nuevas con tu propio contenido. ¡Pásalo bien!', 'Home', '', 'inherit', 'open', 'open', '', '2-autosave-v1', '', '', '2014-01-21 13:28:21', '2014-01-21 13:28:21', '', 2, 'http://localhost/www.rodrigodemingo.com.ar/2-autosave-v1/', 0, 'revision', '', 0); 
INSERT INTO `wp_posts` VALUES (16, 1, '2014-01-21 13:29:17', '2014-01-21 13:29:17', 'Creativity is my principal strength. When it is expressed through technology, the result is smart. RDM Design is ready to hear your needs, open your mind and move further to realize your dreams.', 'Home', '', 'inherit', 'open', 'open', '', '2-revision-v1', '', '', '2014-01-21 13:29:17', '2014-01-21 13:29:17', '', 2, 'http://localhost/www.rodrigodemingo.com.ar/2-revision-v1/', 0, 'revision', '', 0); 
INSERT INTO `wp_posts` VALUES (17, 1, '2014-01-21 13:38:39', '2014-01-21 13:38:39', '<div>\r\n<div id="line">\r\n<div>COMPROMISO</div>\r\n</div>\r\n<div id="texto">\r\n<div>RDM Design es promovido con pasión en el ámbito de la comunicación, el diseño y el arte conceptual.\r\nCon el apoyo de un equipo de expertos en tecnología igualmente apasionados, somos una organización con la madurez requerida y una experiencia muy amplia que permita a nuestros clientes alcanzar el éxito deseado.</div>\r\n<div></div>\r\n<div>FILOSOFÍA</div>\r\n<div>Relación con el cliente\r\nCreemos que nuestro negocio es único, nuestros clientes son únicos y sus necesidades son únicas. Tratamos de generar ideas fuertes y creativas. Nos orientamos en crear una estrecha relación con el cliente, para entenderlos y aconsejarles. Una solución no es algo que sabemos pero es algo que el cliente necesita.Mejora continua\r\nIncorporamos nuevos conocimientos, mejoramos nuestras técnicas y sobre todo, crecemos. Estamos preparados para trabajar sobre diferentes entornos de programación, tecnologías y estándares multimedia.</div>\r\n<div></div>\r\n<div>FORTALEZA</div>\r\n<div>RDM Design está capacitado para responder al exigente mercado. Integrado por profesionales de diferentes áreas (comunicación, publicidad, programación, arquitectura y diseño) preparados para responder a sus necesidades.\r\nNuestros clientes, de diferentes partes del mundo, están conformes con sus proyectos. Acérquese, conózcanos y entérese porqué.</div>\r\n</div>\r\n</div>', 'Me', '', 'inherit', 'open', 'open', '', '13-revision-v1', '', '', '2014-01-21 13:38:39', '2014-01-21 13:38:39', '', 13, 'http://localhost/www.rodrigodemingo.com.ar/13-revision-v1/', 0, 'revision', '', 0); 
