INSERT INTO `wp_posts` VALUES (19, 1, '2014-01-21 13:44:43', '2014-01-21 13:44:43', 'DESARROLLO WEB\r\nDiseño de sitios Web.\r\nRegistro de Dominios.\r\nPosicionamiento en Buscadores (Google, Yahoo).\r\nProductos basados en Flash.\r\nBanners publicitarios.\r\nConversión de Photoshop a XHTML.\r\nProgramación en PHP, Ajax, JQuery, JavaScript.\r\n\r\nDISEÑO AUDIOVISUAL\r\nRDM Design se ha comprometido a proporcionar a los usuarios la alegría de la innovación. Nuestro equipo está formado por expertos en tipografía, diseño, impresión, fotografía y video.\r\nDesarrollo del concepto\r\nPlantilla de Diseño\r\nGuía de estilo para el Desarrollo\r\nIlustración\r\nAnimación\r\nEdición de Audio y Video\r\n\r\nBRANDING E IDENTIDAD\r\nLogo corporativo\r\nTipografía\r\nManual de Normas\r\nPaleta de colores\r\nPapelería\r\nMerchandising\r\nSeñalética\r\nStands\r\n\r\nDISEÑO GRÁFICO\r\nPackaging de productos\r\nPublicidad\r\nDiseño Editorial\r\nRenders 3D de arquitectura\r\nGráfica Vehicular\r\nCartelería\r\nCatálogos\r\n\r\nCOMERCIO ELECTRÓNICO Y CMS\r\nPHP / MySQL\r\nJoomla\r\nDrupal\r\nWordpress\r\n\r\nPLATAFORMAS MÓVILES\r\nRDM Design tiene una amplia experiencia diseñando atractivas interfaces interactivas. Nos centramos en la comprensión de cómo los usuarios interactúan con sus dispositivos y en qué se diferencia el uso de Internet a través de una plataforma con otra. Nuestro trabajo incluye el diseño de plataformas digitales, incluyendo aplicaciones móviles, sitios web para móviles, pantallas digitales en las tiendas y la televisión interactiva.', 'Services', '', 'publish', 'closed', 'closed', '', 'services', '', '', '2014-01-22 12:43:00', '2014-01-22 12:43:00', '', 0, 'http://localhost/www.rodrigodemingo.com.ar/?page_id=19', 0, 'page', '', 0); 
