INSERT INTO `wp_posts` VALUES (32, 1, '2014-01-22 08:05:50', '2014-01-22 08:05:50', '<div id="page">\r\n<div id="contenedor">\r\n<div id="contenedorProyectos">\r\n<ul id="works-list">\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.airesdesign.com.ar/" target="_blank"> <img title="Aires Design" alt="Aires Design" src="http://rodrigodemingo.com.ar/images/aires.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>AIRES DESIGN</h3>\r\nWe have an extensive experience working for different clients in different parts of the world. Our client’s portfolio includes a wide range of industries and services. We develop mobile applications for many platforms (smartphones), or web applications specifically designed for mobile devices (multiplatform).\r\n<h4>Herramientas:</h4>\r\n<div>Responsive Design / HTML5 / CSS3</div>\r\n<div><a href="http://www.airesdesign.com.ar/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div>\r\n<div id="page2">\r\n<div>\r\n<ul id="slider2">\r\n	<li id="rhino-item0"><img alt="3" src="http://rodrigodemingo.com.ar/images/slider/render03.jpg" /></li>\r\n	<li id="rhino-item1"><img alt="4" src="http://rodrigodemingo.com.ar/images/slider/render04.jpg" /></li>\r\n	<li id="rhino-item2"><img alt="5" src="http://rodrigodemingo.com.ar/images/slider/render05.jpg" /></li>\r\n	<li id="rhino-item3"><img alt="6" src="http://rodrigodemingo.com.ar/images/slider/render06.jpg" /></li>\r\n	<li id="rhino-item4"><img alt="7" src="http://rodrigodemingo.com.ar/images/slider/render07.jpg" /></li>\r\n	<li id="rhino-item5"><img alt="8" src="http://rodrigodemingo.com.ar/images/slider/render08.jpg" /></li>\r\n	<li id="rhino-item6"><img alt="1" src="http://rodrigodemingo.com.ar/images/slider/render01.jpg" /></li>\r\n	<li id="rhino-item7"><img alt="2" src="http://rodrigodemingo.com.ar/images/slider/render02.jpg" /></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>RENDERS 3D</h3>\r\nTrabajé en imágenes 3D para simulación de ambientes interiores y exteriores. Para obtener una simulación realista tuve en cuenta el comportamiento tanto de luces, texturas y materiales (agua, madera, metal, plástico, tela, etcétera). Una de las partes más importantes es el motor de renderizado, el cual es capaz de realizar complejos cálculos de iluminación (trazador de rayos), canal alfa, reflexión, refracción o iluminación global que permiten que la simulación de condiciones físicas y lumínicas sean lo suficientemente realistas, logrando difícilmente diferenciar una fotografía de un "render".\r\n<h4>Herramientas:</h4>\r\n<div>3D Max / Vray / Lumion</div>\r\n<div><a href="http://www.josemarconstructora.com.ar/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.gmc.com/" target="_blank"> <img title="GMC" alt="GMC" src="http://rodrigodemingo.com.ar/images/gmc.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>GMC</h3>\r\nTrabajando en MRM Worldwide, participé en la producción digital del sitio en su versión en ingles y español. El cliente necesitaba un sitio de alto impacto visual, que a su vez sea limpio, claro y consistente para navegar. Se utilizaron las últimas tecnologías de diseño web, teniendo siempre en cuenta aspectos de usabilidad para una mejor experiencia de usuario.\r\n<h4>Herramientas:</h4>\r\n<div>HTML5 / CSS3 / JQuery / JavaScript</div>\r\n<div><a href="http://www.gmc.com/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.chevrolet.com/" target="_blank"> <img title="CHEVY" alt="CHEVY" src="http://rodrigodemingo.com.ar/images/chevrolet.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>CHEVY</h3>\r\nTrabajando en MRM Worldwide, participé en la producción digital del si