 <img title="centrum" alt="centrum" src="http://rodrigodemingo.com.ar/images/centrum.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>centrum</h3>\r\nTrabajando en Ci&amp;T, participé en el desarrollo de sitios de alta complejidad sobre la plataforma Drupal. El cliente necesitaba un sitio de facil navegación, que a su vez sea intuitivo para el usuario. Se utilizaron las últimas tecnologías de diseño web, teniendo siempre en cuenta aspectos de usabilidad para una mejor experiencia de usuario.\r\n<h4>Herramientas:</h4>\r\n<div>HTML5 / CSS3 / JQuery / JavaScript</div>\r\n<div><a href="http://www.centrum.com/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.josemarconstructora.com.ar/" target="_blank"> <img title="Aires Design" alt="Aires Design" src="http://rodrigodemingo.com.ar/images/josemar.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>JOHNSON PARK</h3>\r\nSitio desarrollado integramente en WordPress utilizando las tecnologías Jquery, CSS, XHTML. Basado en Renders propios, hechos en 3ds max y vray.\r\n<h4>Herramientas:</h4>\r\n<div>WORDPRESS / HTML5 / CSS3</div>\r\n<div><a href="http://www.josemarconstructora.com.ar/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://rodrigodemingo.com.ar/images/newsletterDelRio2013BIG.png" target="_blank"> <img title="Newsletter" alt="Newsletter" src="http://rodrigodemingo.com.ar/images/newsletterDelRio2013.png" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>NEWSLETTERS</h3>\r\nDiseño integral de Newsletter para escuela de manejo avanzado.\r\n<h4>Herramientas:</h4>\r\n<div>Photoshop / InDesign / Illustrator</div>\r\n<div><a href="http://www.emava.com.ar/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.sonystyle.com.ar/" target="_blank"> <img title="SonyNews!" alt="SonyNews!" src="http://rodrigodemingo.com.ar/images/proyectores_large.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>SONY NEWS!</h3>\r\nDentro del programa de miembros de fidelización al cliente de Sony Argentina, se realizó la gestión de envío de newsletters para los clientes del programa. La selección y la segmentación de la base de datos de destinatarios, el diseño creativo de las piezas y el diagrama de las campañas. La creatividad en el armado de las nuevas promociones para miembros es producto del resultado de los análisis y evaluaciones de cada campaña. De esta manera se han alcanzado objetivos exigentes de conversión de clientes a miembros del programa, mediante acciones de “motivación de compra” que se han llevado a cabo y que han logrado convertir a usuarios de “clientes” a “miembros”.\r\n<h4>Herramientas:</h4>\r\n<div>CSS / Flash / XHTML</div>\r\n<div><a href="http://www.sonystyle.com.ar/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.sonystyle.com.ar/" target="_blank"> <img title="SonyStyle" alt="SonyStyle" src="http://rodrigodemingo.com.ar/images/sonystyle_large.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>SONY STYLE</h3>\r\nSe realizó una propuesta de diseño que la empresa requirió para el desarrollo de un nuevo newsletter para Argentina que responda a las exigencias de actualización de contenidos inmersa en un mercado dinámico y competitivo. Se desarrolló íntegramente un sistema de actualización dinámico de contenidos y se implementó la estética de interface de usuario que la empresa estaba buscando. Todos ellos son actualizables por los usuarios administradores de los contenidos.\r\n<h4>Herramientas:</h4>\r\n<div>CSS / Flash / XHTML</div>\r\n<div><a href="http://www.sonystyle.com.ar/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.rodrigodemingo.com.ar/web/newsletter.html" target="_blank"> <img title="Toyota del Pilar" alt="DelPilar" src="http://rodrigodemingo.com.ar/images/delpilarnews_large.jpg" width="614" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>BROCHURES TOYOTA</h3>\r\nLos Newsletters para los clientes son un requerimiento importante que exige creatividad más que singular e impactante. Por medio de estos comunicados periódicos se logra un buen posicionamiento de la empresa en los usuarios registrados y se los mantiene informados de las diferentes acciones promocionales. Además, a través de un sistema de administración de contenidos se publica y actualiza la información de las diferentes secciones, como el catálogo de productos, lanzamientos, información institucional, etc. Estos adelantos logran una alineación gráfica que refleja los nuevos objetivos de comunicación institucional de la empresa.\r\n<h4>Herramientas:</h4>\r\n<div>CSS / Flash / HTML</div>\r\n<div><a href="http://www.rodrigodemingo.com.ar/web/newsletter.html" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div></div>\r\n<div>\r\n<h3>TOYOTA DEL PILAR</h3>\r\nToyota del Pilar busca identificarse con un catálogo de productos que asocia cada vehículo con sus respectivos accesorios. Logra despegarse de sus competidores y sumar valor agregado en sus publicaciones.  De esta manera se logra un catálogo exclusivo en papel de alta calidad y brillantes colores, para dar un look estupendo y una sensación confortable al tacto.  El resultado es todo un éxito.\r\n<h4>Herramientas:</h4>\r\n<div>CSS / Flash / HTML</div>\r\n<div><a href="http://www.rodrigodemingo.com.ar/web/newsletter.html" target="_blank">PRESENTACIÓN</a></div>\r\n</div></li>\r\n	<li>\r\n<div></div>\r\n<div>\r\n<h3>VIDEO SONY XPLOD</h3>\r\nSony expuso en Japón el video promocional de su nueva línea de Car Audio conocida como Sony X-Plod. El mismo fue filmado en la Exposición del Automóvil donde se trabajó con equipos de captura y edición de video digital. El DVD final fue alineado a la estética de la marca y presentaba dentro de sus contenidos las especificaciones técnicas del producto, sus diferentes modelos dentro de la línea y sus prestaciones más importantes.\r\n<h4>Herramientas:</h4>\r\n<div>Adobe Premiere</div>\r\n<div>VIDEO</div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.cosas-magicas.com.ar" target="_blank"> <img title="Cosas Mágicas" alt="CosasMagicas" src="http://rodrigodemingo.com.ar/images/cosas_magicas_large.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>COSAS MÁGICAS</h3>\r\nEn conjunto con un cambio de imagen que la compañía está realizando se buscó implementar un nuevo Look de las interfaces gráficas de usuarios del sitio institucional. Esta basado en una solución desarrollada íntegramente en Flash y transmite los conceptos claves de la mecánica de la compañía. De una manera ágil y dinámica presenta todos los detalles de sus agendas, libros y demás material editorial.\r\n<h4>Herramientas:</h4>\r\n<div>Flash / XHTML</div>\r\n<div><a href="http://www.cosas-magicas.com.ar/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.emava.com.ar" target="_blank"> <img title="EMAVA S.A. - Escuela de conducción avanzada" alt="Emava" src="http://rodrigodemingo.com.ar/images/emava_large.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>EMAVA S.A.</h3>\r\nLa necesidad de contar con un sitio nuevo surgió principalmente por la necesidad de expansión que la empresa está tendiendo en la actualidad. La escuela de manejo avanzado Jorge Omar del Río ofrece a través de su nuevo sitio información clave a cerca de sus servicios y cursos de conducción. Una nueva estética se trabajó dentro del sitio para reflejar los cambios que la empresa ha desarrollado para lograr el crecimiento exponencial tras la apertura de su nueva filial en Brasil.\r\n<h4>Herramientas:</h4>\r\n<div>CSS / Flash / JQuery / JavaScript</div>\r\n<div><a href="http://www.emava.com.ar/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.dwmaquinaria.com/" target="_blank"> <img title="DWMaquinaria" alt="DWMaquinaria" src="http://rodrigodemingo.com.ar/images/dwmaquinarias_large.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>DW MAQUINARIA</h3>\r\nDW Maquinaria cuenta con más de 20 años participando en el negocio de máquinas herramienta. Se desarrolló para la compañía, una solución que le permite al usuario navegar por un sitio que responde a una navegación intuitiva y  amigable.\r\n<h4>Herramientas:</h4>\r\n<div>Flash / XHTML</div>\r\n<div><a href="http://www.dwmaquinaria.com/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><img title="HispanaJeans" alt="HispanaJeans" src="http://rodrigodemingo.com.ar/images/hispana_large.jpg" width="618" height="458" border="0" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>HISPANA</h3>\r\nSe realizó una propuesta para el cliente a fin de diseñar un sitio, dándole una estética “fotográfica”, clara y ligera. Uno de los objetivos era lograr que el sitio respondiera a una demanda de actualización de contenidos permanente sin generar un gran esfuerzo de desarrollo. Se planteó el desarrollo limpio en su diseño, respetando textura y colorimetría de Hispana, y recalcando la marca. El sitio pasará a ser una nueva carta de presentación de la empresa, para realizar presentaciones de la compañía y otras acciones de comunicación empresaria.\r\n<h4>Herramientas:</h4>\r\n<div>CSS / Flash / XHTML</div>\r\n<div>OFFLINE</div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.graficadistack.com.ar/" target="_blank"> <img title="Distack" alt="Distack" src="http://rodrigodemingo.com.ar/images/distack_large.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>DISTACK</h3>\r\nDistack es una empresa que nació en 1997 en manos de jóvenes profesionales con la finalidad de brindar un servicio de excelencia en el rubro de comunicación visual. La empresa requirió el desarrollo de un nuevo sito web que responda a las exigencias de actualización de contenidos inmersa en un mercado dinámico y competitivo. Se trabajo bajo la regla de simplicidad en el acceso a los contenidos, rápida velocidad de carga y absoluta claridad visual.\r\n<h4>Herramientas:</h4>\r\n<div>Flash / HTML</div>\r\n<div><a href="http://www.graficadistack.com.ar/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><img title="GráficaVehicular" alt="GráficaVehicular" src="http://rodrigodemingo.com.ar/images/camionetas_large.jpg" width="618" height="458" border="0" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>REGIONALES P.P.</h3>\r\nLa grafica vehicular es el diseño de una pieza gráfica que se imprime sobre la estructura de un vehículo. Suele usarse a modo publicitario, decorativo, informativo o institucional. Regionales PP usó nuestros diseños para una campaña masiva de productos regionales para todo el país.\r\n<h4>Herramientas:</h4>\r\n<div>Adobe Illustrator / Photoshop</div>\r\n<div>GRÁFICA</div>\r\n</div></li>\r\n	<li>\r\n<div>\r\n<div>\r\n<div>\r\n<div><a href="http://www.masoil.com.ar/" target="_blank"> <img title="MasOil" alt="MasOil" src="http://rodrigodemingo.com.ar/images/masoil_large.jpg" width="618" height="458" border="0" /> </a></div>\r\n</div>\r\n</div>\r\n</div>\r\n<div>\r\n<h3>MASOIL</h3>\r\nMasoil S.A. es la empresa Argentina líder en distribución de lubricantes. Se desarrolló un sitio totalmente dinámico alineado a las nuevas tendencias de navegación y comunicación en Internet. Presenta un catálogo completo de todos los productos, con fotos y fichas técnicas descargables en formato PDF. Puede verse con menúes de doble entrada por marca o por producto.\r\n<h4>Herramientas:</h4>\r\n<div>Flash / HTML</div>\r\n<div><a href="http://www.masoil.com.ar/" target="_blank">Visitar Sitio</a></div>\r\n</div></li>\r\n</ul>\r\n</div>\r\n</div>\r\n</div>', 'Work', '', 'inherit', 'open', 'open', '', '23-revision-v1', '', '', '2014-01-22 08:05:50', '2014-01-22 08:05:50', '', 23, 'http://localhost/www.rodrigodemingo.com.ar/23-revision-v1/', 0, 'revision', '', 0); 
INSERT INTO `wp_posts` VALUES (35, 1, '2014-01-22 12:11:08', '2014-01-22 12:11:08', '<p>Su nombre (requerido)<br />\r\n    [text* your-name] </p>\r\n\r\n<p>Su e-mail (requerido)<br />\r\n    [email* your-email] </p>\r\n\r\n<p>Asunto<br />\r\n    [text your-subject] </p>\r\n\r\n<p>Su mensaje<br />\r\n    [textarea your-message] </p>\r\n\r\n<p>[submit "Enviar"]</p>\n[your-subject]\n[your-name] <[your-email]>\nDe: [your-name] <[your-email]>\r\nAsunto: [your-subject]\r\n\r\nCuerpo del mensaje:\r\n[your-message]\r\n\r\n--\r\nEste e-mail se ha enviado vía formulario de contacto desde Rodrigo de Mingo http://localhost/www.rodrigodemingo.com.ar\nrodrigodemingo@gmail.com\n\n\n\n\n[your-subject]\n[your-name] <[your-email]>\nCuerpo del mensaje:\r\n[your-message]\r\n\r\n--\r\nEste e-mail se ha enviado vía formulario de contacto desde Rodrigo de Mingo http://localhost/www.rodrigodemingo.com.ar\n[your-email]\n\n\n\nSu mensaje se ha enviado con éxito. Muchas gracias.\nFalló el envío del mensaje. Por favor, inténtelo más tarde o contacte con el administrador por otro medio.\nOcurrió un error de validación. Por favor, confirme los campos y envíe el formulario de nuevo.\nFalló el envío del mensaje. Por favor, inténtelo más tarde o contacte con el administrador por otro medio.\nPor favor, acepte los términos y condiciones para continuar.\nPor favor, complete el campo requerido.\nEl código ingresado es incorrecto.\nEl formato numérico parece inválido.\nNúmero demasiado pequeño.\nNúmero demasiado grande.\nLa dirección e-mail parece inválida.\nEl URL parece inválido.\nEl número de teléfono parece inválido.\nLa respuesta no es correcta.\nEl formato de fecha parece inválido.\nFecha demasiado temprana.\nFecha demasiado tardía.\nFalló la subida del archivo.\nFormato de archivo inválido.\nEste archivo es demasiado grande.\nFalló la subida del archivo. Ocurrió un error.', 'Formulario de contacto 1', '', 'publish', 'open', 'open', '', 'formulario-de-contacto-1', '', '', '2014-01-22 12:12:26', '2014-01-22 12:12:26', '', 0, 'http://localhost/www.rodrigodemingo.com.ar/?post_type=wpcf7_contact_form&#038;p=35', 0, 'wpcf7_contact_form', '', 0); 
